const styles = {
  navbar: {
    width: "100%",
    backgroundColor: "#333",
    color: "white",
    padding: "1rem",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    position: "fixed", // Fix the navbar to top
    top: 0,
    left: 0,
    zIndex: 1000, // Ensure it stays above other elements
  },
  links: {
    display: "flex",
    gap: "1rem",
    textDecoration: "none",
    color: "white",
  },
};
